export default {
	data() {
		return {
			isLoading: false,
			helpList: [],
			activeName: '0'
		};
	},
	created() {
		this.getVipHelp();
	},
	methods: {
		getVipHelp() {
			let self = this;
			this.$axios
				.getUserHelp()
				.then(res => {
					this.helpList = res.data.data.list;
					setTimeout(function() {
						self.isLoading = true;
					}, 500);
				})
				.catch(err => {});
		},
		ToText(HTML) {
			var input = HTML;
			return input
				.replace(/<(style|script|iframe)[^>]*?>[\s\S]+?<\/\1\s*>/gi, '')
				.replace(/<\/?(img)[^>]*>/gi, '')
				.replace(/<[^>]+?>/g, '')
				.replace(/\s+/g, ' ')
				.replace(/ /g, ' ')
				.replace(/>/g, ' ');
		}
	},
	components: {}
};
